import React, { Component } from "react";
import Map from './Map'

class Layout extends Component {
  render() {
    return (
      <div>
        <div className="map"> Map </div>
        <div className="board-row">
          {this.renderSquare(0)}
          {this.renderSquare(1)}
          {this.renderSquare(2)}
        </div>
      </div>
    );
  }
}

export default Layout;
